function PopupWithForm(isOpen, name, title, onClose, children, onSubmit) {
    return(
        <section className={isOpen ? `popup popup_opened popup_${name}` : `popup_${name} popup`}>
          <div className="popup__container">
            <button className="popup__close-btn" onClick={onClose}/>
            <form className={`popup__form-${name} popup__form popup__content`} onSubmit={onSubmit}>
              <h2 className={`${name}__title`}>{title}</h2>
              {children}
            </form>
          </div>
        </section>
    )
}

export default PopupWithForm
